import React from 'react';
import Frame from './components/Frame';
import {Routes,Route} from 'react-router-dom';
import { adminRoutes } from './routes';

function App() {
    return (
        <Frame>
            <Routes>
                {adminRoutes.map(route=>{
                    return <Route key={route.path} {...route}/>;
                })}
            </Routes>
        </Frame>
    )
}

export default App
